import React from 'react';
import ReactDOM from 'react-dom';
import {add, sub, mul, div} from './App'; 

ReactDOM.render(
  <>
    <ul>
      <li>The addition of two numbers is: {add(10,3)}</li>
      <li>The Subtraction of two numbers is: {sub(10,3)}</li>
      <li>The Multiplication of two numbers is: {mul(10,3)}</li>
      <li>The Division of two numbers is: {div(10,3)}</li>
    </ul>
  </>,
  document.getElementById('root')
);
